web__StyledText-sc-1fa9e8r-0 iqORTp">Konten ini diproduksi oleh </span><a href="/millennial/organisation-info"><span class="Textweb__StyledText-sc-1fa9e8r-0 fiFYdF">kumparan</span></a></div></div></div></div><div class="StoryRenderer__EditorWrapper-mnwwoh-0 gZLNBF"><div data-key="7591041" class="components__NormalWidth-kpb67a-0 components__FullWidth-kpb67a-1 jxuNGw kCqlrE"></div><div data-key="7591044" class="components__NormalWidth-kpb67a-0 components__Inset-kpb67a-3 jxuNGw cwlOLr"><figure data-key="7591044" class="Helper__StyledFigure-sc-5998y0-6 XbWcq"><div data-key="7591045" class="Helper__MediaWrapper-sc-5998y0-7 idKDxH"><div width="100%" height="49.70703125%" class="ImageLoader__Placeholder-sc-16hvfjk-0 jESDgU"><img width="100%" src="https://blue.kumparan.com/image/upload/fl_progressive,fl_lossy,c_fill,q_auto:best,w_640/v1610537030/ksp48pjw0kaljrcz8iff.jpg" alt="TikTok Akan Gelar TikTok Awards Indonesia untuk Apresiasi Kreator (155057)"/></div></div><figcaption data-key="7591048" class="Helper__MediaCaption-sc-5998y0-9 OTlsy"><span>TikTok Awards Indonesia dok TikTok</span></figcaption></figure></div><div data-key="7591051" class="components__NormalWidth-kpb67a-0 jxuNGw"><div data-key="7591051" class="Viewweb__StyledView-p5eu6e-0 eWGaoq track_paragraph"><div class="TextBoxweb__StyledTextBox-sc-1wzqkk1-0 hwNlLi"><span class="Textweb__StyledText-sc-1fa9e8r-0 laLMaB"><em data-key="7591887"><span>Platform </span></em><span>berbagi video singkat, </span><a href="https://kumparan.com/topic/tiktok" to="https://kumparan.com/topic/tiktok" data-key="7591056" class="LabelLinkweb-njxxwb-0 cJvuwm components__StyledLink-l7tpkn-0 bpZIsU"><span>TikTok</span></a><span>, akan menggelar ajang</span><span>  </span><span>TikTok Indonesia Awards sebagai bentuk penghargaan kepada para kreator.</span></span></div></div></div><div data-key="7591066" class="components__NormalWidth-kpb67a-0 jxuNGw"><div></div><div style="width:100%"></div></div><div data-key="7591067" class="components__NormalWidth-kpb67a-0 jxuNGw"><div class="Viewweb__StyledView-p5eu6e-0 fgvAjn"><div data-qa-id="desktop-article-page-inline-1" class="Viewweb__StyledView-p5eu6e-0 jqDfEK"><div class="Viewweb__StyledView-p5eu6e-0 bgYAsi"><div id="ads-container" class="Viewweb__StyledView-p5eu6e-0 nryyq AdsDFPView__AdsWrapper-sc-1eszjj1-0 jkaBiq"><div class="Viewweb__StyledView-p5eu6e-0 bJztYW"><span class="Textweb__StyledText-sc-1fa9e8r-0 jnoZFo">ADVERTISEMENT</span></div><div class="adunitContainer"><div class="adBox"></div></div></div></div></div></div></div><div data-key="7591068" class="components__NormalWidth-kpb67a-0 jxuNGw"><div data-key="7591068" class="Viewweb__StyledView-p5eu6e-0 eWGaoq track_paragraph"><div class="TextBoxweb__StyledTextBox-sc-1wzqkk1-0 hwNlLi"><span class="Textweb__StyledText-sc-1fa9e8r-0 laLMaB"><span>TikTok Awards Indonesia merupakan bagian dari program #samasamamenang yaitu lanjutan dari kampanye #samasamadariTikTok untuk merayakan tren yang berawal di TikTok. </span></span></div></div></div><div data-key="7591071" class="components__NormalWidth-kpb67a-0 jxuNGw"><div></div><div style="width:100%"></div></div><div data-key="7591072" class="components__NormalWidth-kpb67a-0 jxuNGw"><div data-key="7591072" class="Viewweb__StyledView-p5eu6e-0 eWGaoq track_paragraph"><div class="TextBoxweb__StyledTextBox-sc-1wzqkk1-0 hwNlLi"><span class="Textweb__StyledText-sc-1fa9e8r-0 laLMaB"><span>Mulai dari kesuksesan para kreator dengan karyanya yang mampu dikenal banyak orang, tren </span><em data-key="7591888"><span>hashtag challenge</span></em><span> yang menginspirasi, hingga musik dari Indonesia yang semakin mendunia.</span></span></div></div></div><div data-key="7591078" class="components__NormalWidth-kpb67a-0 jxuNGw"><div></div><div style="width:100%"></div></div><div data-key="7591079" class="components__NormalWidth-kpb67a-0 jxuNGw"><div data-key="7591079" class="Viewweb__StyledView-p5eu6e-0 eWGaoq track_paragraph"><div class="TextBoxweb__StyledTextBox-sc-1wzqkk1-0 hwNlLi"><span class="Textweb__StyledText-sc-1fa9e8r-0 laLMaB"><span>&quot;TikTok menyediakan </span><em data-key="7591889"><span>platform</span></em><span> untuk mengekspresikan kreativitasnya. Sepanjang tahun lalu pun kami melihat bagaimana para kreator baru bermunculan dengan konten yang menghibur serta menginspirasi banyak orang. Berbagai kreator dan konten inspiratif tersebut dapat terlihat dari nominasi yang masuk ke dalam TikTok Awards Indonesia ini,&quot; ungkap Angga Anugrah Putra selaku Head of User and Content Operations TikTok Indonesia, dari keterangan yang diterima </span><strong data-key="7591890"><span>kumparan</span></strong><span>.</span></span></div></div></div><div data-key="7591088" class="components__NormalWidth-kpb67a-0 jxuNGw"><div></div><div style="width:100%"></div></div><div data-key="7591089" class="components__NormalWidth-kpb67a-0 components__Inset-kpb67a-3 jxuNGw cwlOLr"><figure data-key="7591089" class="Helper__StyledFigure-sc-5998y0-6 XbWcq"><div data-key="7591090" class="Helper__MediaWrapper-sc-5998y0-7 idKDxH"><div width="100%" height="46.15384615384615%" class="ImageLoader__Placeholder-sc-16hvfjk-0 kOoVVC"><img width="100%" src="https://blue.kumparan.com/image/upload/fl_progressive,fl_lossy,c_fill,q_auto:best,w_640/v1610537058/r7ejm7ttyvd7jg8aoohx.jpg" alt="TikTok Akan Gelar TikTok Awards Indonesia untuk Apresiasi Kreator (155058)"/></div></div><figcaption data-key="7591093" class="Helper__MediaCaption-sc-5998y0-9 OTlsy"><span>Angga Anugrah Putra selaku Head of User and Content Operations TikTok Indonesia dok TikTok</span></figcaption></figure></div><div data-key="7591096" class="components__NormalWidth-kpb67a-0 jxuNGw"><div data-key="7591096" class="Viewweb__StyledView-p5eu6e-0 eWGaoq track_paragraph"><div class="TextBoxweb__StyledTextBox-sc-1wzqkk1-0 hwNlLi"><span class="Textweb__StyledText-sc-1fa9e8r-0 laLMaB"><span>Terdapat 14 kategori seperti kreator pendatang baru, selebriti, sampai konten di bidang fesyen, teknologi, dan kesehatan.</span></span></div></div></div><div data-key="7591099" class="components__NormalWidth-kpb67a-0 jxuNGw"><div></div><div style="width:100%"></div></div><div data-key="7591100" class="components__NormalWidth-kpb67a-0 jxuNGw"><div class="Viewweb__StyledView-p5eu6e-0 fgvAjn"><div data-qa-id="desktop-article-page-inline-2" class="Viewweb__StyledView-p5eu6e-0 jqDfEK"><div class="Viewweb__StyledView-p5eu6e-0 bgYAsi"><div id="ads-container" class="Viewweb__StyledView-p5eu6e-0 nryyq AdsDFPView__AdsWrapper-sc-1eszjj1-0 jkaBiq"><div class="Viewweb__StyledView-p5eu6e-0 bJztYW"><span class="Textweb__StyledText-sc-1fa9e8r-0 jnoZFo">ADVERTISEMENT</span></div><div class="adunitContainer"><div class="adBox"></div></div></div></div></div></div></div><div data-key="7591101" class="components__NormalWidth-kpb67a-0 jxuNGw"><div data-key="7591101" class="Viewweb__StyledView-p5eu6e-0 eWGaoq track_paragraph"><div class="TextBoxweb__StyledTextBox-sc-1wzqkk1-0 hwNlLi"><span class="Textweb__StyledText-sc-1fa9e8r-0 laLMaB"><span>Enam kategorinya akan didasarkan kepada </span><em data-key="7591891"><span>vote</span></em><span> dari masyarakat, dan delapan lainnya ditentukan oleh penilaian juri seperti Maia Estianty, Fabian Dharmawan selaku Head of Production Operation Division </span><a href="https://kumparan.com/topic/rcti" to="https://kumparan.com/topic/rcti" data-key="7591107" class="LabelLinkweb-njxxwb-0 cJvuwm components__StyledLink-l7tpkn-0 bpZIsU"><span>RCTI</span></a><span>, dan Angga Anugrah Putra selaku Head of User &amp; Content Operations TikTok Indonesia.</span></span></div></div></div><div data-key="7591112" class="components__NormalWidth-kpb67a-0 jxuNGw"><div></div><div style="width:100%"></div></div><div data-key="7591113" class="components__NormalWidth-kpb67a-0 jxuNGw"><div data-key="7591113" class="Viewweb__StyledView-p5eu6e-0 eWGaoq track_paragraph"><div class="TextBoxweb__StyledTextBox-sc-1wzqkk1-0 hwNlLi"><span class="Textweb__StyledText-sc-1fa9e8r-0 laLMaB"><span>Melalui TikTok Awards Indonesia, RCTI dan TikTok bersama memberikan apresiasi kepada para kreator konten Indonesia. Kami melihat variasi konten yang bagus mulai dari yang menghibur, informatif, sampai inspiratif. Semoga ajang ini bisa memberikan semangat bagi kreator Indonesia lainnya, ucap Fabian.</span></span></div></div></div><div data-key="7591116" class="components__NormalWidth-kpb67a-0 jxuNGw"><div></div><div style="width:100%"></div></div><div data-key="7591117" class="components__NormalWidth-kpb67a-0 jxuNGw"><div data-key="7591117" class="Viewweb__StyledView-p5eu6e-0 eWGaoq track_paragraph"><div class="TextBoxweb__StyledTextBox-sc-1wzqkk1-0 hwNlLi"><span class="Textweb__StyledText-sc-1fa9e8r-0 laLMaB"><span>Selain itu, TikTok Awards Indonesia akan dimeriahkan oleh penampilan dari Rizky Febian, Marion Jola, sampai Tiara Andini. </span></span></div></div></div><div data-key="7591120" class="components__NormalWidth-kpb67a-0 jxuNGw"><div></div><div style="width:100%"></div></div><div data-key="7591121" class="components__NormalWidth-kpb67a-0 jxuNGw"><div data-key="7591121" class="Viewweb__StyledView-p5eu6e-0 eWGaoq track_paragraph"><div class="TextBoxweb__StyledTextBox-sc-1wzqkk1-0 hwNlLi"><span class="Textweb__StyledText-sc-1fa9e8r-0 laLMaB"><span>Akan ada juga penampilan dari </span><a href="https://kumparan.com/topic/content-creator" to="https://kumparan.com/topic/content-creator" data-key="7591124" class="LabelLinkweb-njxxwb-0 cJvuwm components__StyledLink-l7tpkn-0 bpZIsU"><em data-key="7591892"><span>content creator</span></em></a><span> TikTok seperti </span><span>Asyraf</span><span> Jamal, Jessica Bunga, serta DJ TikTok Tian Storm. </span></span></div></div></div><div data-key="7591135" class="components__NormalWidth-kpb67a-0 jxuNGw"><div></div><div style="width:100%"></div></div><div data-key="7591136" class="components__NormalWidth-kpb67a-0 jxuNGw"><div class="Viewweb__StyledView-p5eu6e-0 fgvAjn"><div data-qa-id="desktop-article-page-inline-3" class="Viewweb__StyledView-p5eu6e-0 jqDfEK"><div class="Viewweb__StyledView-p5eu6e-0 bgYAsi"><div id="ads-container" class="Viewweb__StyledView-p5eu6e-0 nryyq AdsDFPView__AdsWrapper-sc-1eszjj1-0 jkaBiq"><div class="Viewweb__StyledView-p5eu6e-0 bJztYW"><span class="Textweb__StyledText-sc-1fa9e8r-0 jnoZFo">ADVERTISEMENT</span></div><div class="adunitContainer"><div class="adBox"></div></div></div></div></div></div></div><div data-key="7591137" class="components__NormalWidth-kpb67a-0 jxuNGw"><div data-key="7591137" class="Viewweb__StyledView-p5eu6e-0 eWGaoq track_paragraph"><div class="TextBoxweb__StyledTextBox-sc-1wzqkk1-0 hwNlLi"><span class="Textweb__StyledText-sc-1fa9e8r-0 laLMaB"><span>Untuk pembaca </span><span>nominasinya</span><span> ada Chef Arnold Poernomo, Sule, Ayu Dewi, dan masih banyak lagi. TikTok Awards Indonesia akan dipandu oleh Raffi Ahmad dan Cinta Laura Kiehl.</span></span></div></div></div><div data-key="7591145" class="components__NormalWidth-kpb67a-0 jxuNGw"><div></div><div style="width:100%"></div></div><div data-key="7591146" class="components__NormalWidth-kpb67a-0 jxuNGw"><div data-key="7591146" class="Viewweb__StyledView-p5eu6e-0 eWGaoq track_paragraph"><div class="TextBoxweb__StyledTextBox-sc-1wzqkk1-0 hwNlLi"><span class="Textweb__StyledText-sc-1fa9e8r-0 laLMaB"><span>Acara ini bakal digelar pada 30 Januari 2021 dan disiarkan langsung di RCTI mulai pukul 17.00 WIB, dan dapat disaksikan di TikTok.</span></span></div></div></div><div data-key="7591149" class="components__NormalWidth-kpb67a-0 jxuNGw"><div></div><div style="width:100%"></div></div><div data-key="7591150" class="components__NormalWidth-kpb67a-0 jxuNGw"><div data-key="7591150" class="Viewweb__StyledView-p5eu6e-0 eWGaoq"><h2 style="margin:0"><span class="Textweb__StyledText-sc-1fa9e8r-0 fniEZq"><span>Daftar Nominasi TikTok Awards Indonesia</span></span></h2></div></div><div data-key="7591153" class="components__NormalWidth-kpb67a-0 components__Inset-kpb67a-3 jxuNGw cwlOLr"><figure data-key="7591153" class="Helper__StyledFigure-sc-5998y0-6 XbWcq"><div data-key="7591154" class="Helper__MediaWrapper-sc-5998y0-7 idKDxH"><div width="100%" height="56.24%" class="ImageLoader__Placeholder-sc-16hvfjk-0 kMbSQZ"><img width="100%" src="https://blue.kumparan.com/image/upload/fl_progressive,fl_lossy,c_fill,q_auto:best,w_640/v1599816731/gq0hpjhorctup8qqcozt.jpg" alt="TikTok Akan Gelar TikTok Awards Indonesia untuk Apresiasi Kreator (155059)"/></div></div><figcaption data-key="7591157" class="Helper__MediaCaption-sc-5998y0-9 OTlsy"><span>Ilustrasi TikTok. Foto: </span><span>DADO</span><span> </span><span>RUVIC</span><span>/REUTERS</span></figcaption></figure></div><div data-key="7591170" class="components__NormalWidth-kpb67a-0 jxuNGw"><div data-key="7591170" class="Viewweb__StyledView-p5eu6e-0 eWGaoq track_paragraph"><div class="TextBoxweb__StyledTextBox-sc-1wzqkk1-0 hwNlLi"><span class="Textweb__StyledText-sc-1fa9e8r-0 laLMaB"><span>Untuk memberikan dukungan kepada kreator TikTok favorit, dapat melakukan </span><em data-key="7591893"><span>voting</span></em><span> di aplikasi RCTI+ dan TikTok mulai 13-29 Januari 2021 pukul 00.00. Setiap akun dapat melakukan </span><em data-key="7591894"><span>voting</span></em><span> sebanyak tiga kali dalam satu hari. </span></span></div></div></div><div data-key="7591179" class="components__NormalWidth-kpb67a-0 jxuNGw"><div></div><div style="width:100%"></div></div><div data-key="7591180" class="components__NormalWidth-kpb67a-0 jxuNGw"><div data-key="7591180" class="Viewweb__StyledView-p5eu6e-0 eWGaoq track_paragraph"><div class="TextBoxweb__StyledTextBox-sc-1wzqkk1-0 hwNlLi"><span class="Textweb__StyledText-sc-1fa9e8r-0 laLMaB"><span>Berikut nominasi selengkapnya:</span></span></div></div></div><div data-key="7591183" class="components__NormalWidth-kpb67a-0 jxuNGw"><div></div><div style="width:100%"></div></div><div data-key="7591184" class="components__NormalWidth-kpb67a-0 jxuNGw"><div data-key="7591184" class="Viewweb__StyledV